# 1 Музыкальный плеер для iPhone и Mac!

iTunes, личная музыкальная коллекция, SoundCloud®, Spotify - слушай музыку в отличном качеcтве из разных музыкальных источников.

Основные функции:

- VOX поддерживает все популярные аудио форматы, включая Hi-Res.
• Lossless: FLAC, APE, WAV, ALAC и т.д.  Lossy: MP3, WMA, OGG и т.д. 
VOX играет все Hi-Res форматы, используя сделанный нами  звуковой движок на основе BASS™. 

- Универсальный музыкальный плеер с вашими любимыми музыкальными источниками музыки:
• iTunes библиотека;
• Личная коллекция FLAC и MP3 музыки;
• Стримминг из SoundCloud® и Spotify;
• Онлайн радио с 30'000 + радиостанциями по всему миру;
• Last.fm скробблинг.

Расширенные аудио настройки:
• Воспроизведение FX (Crossfade, Time Stretch, Tempo Adjustment);
• Никаких пауз между треками (Gapless playback);
• Стримминг через AirPlay;
• Эквалайзер с 30 преднастроенными профилями;
• Поддержка CarPlay;
• Поддержка Sonos;
• BS2B;
• Синхронизация частоты дискретизации (Sync Sample Rate).

- Музыкальное облачное хранилище для подписчиков VOX Премиум:
• Неограниченное облачное хранилище для музыкальных коллекций;
• Синхронизируйте музыкальные плейлисты на всех Apple устройствах (Mac и iPhone);
• Оригинальное качество воспроизведения (VOX не пережимает музыкальные файла при заливке и хранении в облаке. FLAC остается FLAC);
• Прослушивание музыки оффлайн.

- Универсальное управление и перемещение музыки между Apple устройствами:
• Передача музыки по Wi-Fi  (AirDrop);
• Общий доступ к файлам iTunes;
• Управление списком воспроизведения. Вы можете комбинировать свои треки iTunes, SoundCloud и Spotify, а также ваши локальные файлы в один плейлист и сделать их доступными для всех ваших Apple устройств!
• Простое управление музыкальной очередью («Играть следующим», «Добавить в очередь» с полным списком очереди).

- Уникальный дизайн. Мы улучшили дизайн для iOS версии для более простого и понятного использования:
• Интуитивный интерфейс;
• Поддержка Force Touch;
• Делитесь музыкой с друзьями через SoundCloud®.


Стоимость подписки на VOX Premium:
– $4.99 / месяц;
– $49.99 / год.

Оплата с кредитной карточки будет снята после подтверждения покупки. Ваша подписка будет автоматически обновляться, если только вы не отмените подписку не менее чем за 24 часа до окончания выбранного периода. Если вы отменили подписку до окончания вашего периода, платные функции будут недоступны. При повторной подписке на VOX Premium ваш период начинается заново с момента покупки. 

Политика конфиденциальности: https://vox.rocks/privacy
Условия и положения: https://vox.rocks/terms

 P.S.: FLAC Player, ALAC Player, Lossless Player, SoundCloud® Stream Solution, Hi-Res audio Player, Spotify.

Уроки Вокала: Время Петь - ваш личный, карманный тренер по вокалу! Практикуйте и улучшайте свои навыки в любое время и в любом месте. Упражнения для распевки, полезные дыхательные упражнения и многое другое. Это целая вокальная школа, как для начинающих, так и для профессионалов.

Как использовать: во-первых, выберите ваш вокальный диапазон: прослушайте примеры и выберите тот, который подходит именно вам. Кроме того, есть два типа упражнений: пение и дыхание. Вокальные упражнения: последовательность нот. Нажмите кнопку, чтобы воспроизвести мелодию, начните петь и постарайтесь попадать в ноты. Дыхательные упражнения с секундомером помогут вам улучшить ваше дыхание во время пения. Ознакомьтесь с общей информацией.

Особенности приложения Уроки Вокала: Время Петь:
- Полезные упражнения и вокальная практика;
- Последовательность мелодий, чтобы попадать в ноты;
- Понятные тексты и рисунки;
- Полезный информационный раздел.

Никогда не откладывай на завтра то, что можно сделать сегодня. Начните обучение вокалу прямо сейчас, вместе с приложением Уроки Вокала: Время Петь!

Теперь не нужно тратить время на поиск хорошей музыки, достаточно включить Радио Бананастрит и наслаждаться прямым эфиром! Источник позитивного настроения, наполненный работами известных диджеев со всего мира. Идеально подходит в качестве фоновой музыки для любого занятия.

Ключевые особенности:
– Абсолютно бесплатно;
– Без рекламы;
– Без голосовых шоу;
– Простота использования;
– Работает в фоновом режиме.

Найдите на наших книжных полках что-то новое для себя! Приложение представляет из себя каталог аудиокниг, которые вы можете прослушать прямо со своего устройства.
Познакомьтесь с миром сказок, откройте для себя признанные шедевры литературы, погрузитесь в мистическую атмосферу коротких историй. Не упустите возможность послушать сказки братьев Гримм на языке оригинала!
Познакомьтесь с произведениями таких писателей, как Амброз Бирс, Антон Чехов, Хенри Ван Дайк и многих других.

- 72 аудиокниги различных жанров;
- 7 категорий: от приключений до ужасов;
- новая книга каждую неделю;
- слушайте книги в режиме онлайн;
- возможность прослушивания без подключения к сети.

Audio Bookshelves - ваша персональная коллекция рассказов на языке оригинала, написанных всемирно известными авторами.

Премиум-подписка
- Премиум-подписка дает вам 1 месяц полного доступа к нашей регулярно обновляемой коллекции аудиокниг, позволяет слушать их в автономном режиме и наслаждаться приложением без рекламы.
- Цена подписки составляет $9,99.
- Подписка имеет 7 дней бесплатного пробного периода и автоматически продлится как платная подписка.
- Премиум-подписка автоматически продлится течение одного дня до того, как кончится текущий период подписки;
- Опция автовозобновления может быть отключена в настройка аккаунта iTunes;
- Платеж будет списан с вашего аккаунта iTunes после подтверждения платежа;
- Действующую в настоящий момент подписку нельзя отменить.

Политика конфиденциальности: http://musictopia.club/privacy.html

Условия использования: http://musictopia.club/tos.html

Запущена новая версия приложения WAE Music!

Это бесплатное приложение разработано специально для владельцев продуктов из линейки Hercules WAE (Wireless Audio Experience).

Приложение WAE Music было полностью обновлено и теперь обеспечивает новые уникальные возможности для прослушивания музыки.

Оно предлагает следующие возможности:

- улучшенный графический интерфейс для супербыстрой навигации по приложению;
- полнофункциональный музыкальный проигрыватель;
- сервисы потоковой передачи аудио: все музыкальные библиотеки пользователя (локальная и на сервисах Deezer, Spotify и SoundCloud) сведены в одном приложении;
- воспроизведение любой композиции в любое время благодаря базам данных музыкальных сервисов;
- создание собственных плейлистов и их комбинирование вне зависимости от места хранения композиций (в локальной библиотеке или в сервисе потоковой передачи);
- полнофункциональный эквалайзер для настройки музыки;
- интеграция социальных сетей, возможность поделиться любимой музыкой с друзьями;
- просмотр уровня заряда аккумулятора* динамика;
- режим сна*;
- функция будильника*.

*Доступно только на совместимых динамиках WAE.

Помимо всех этих функций, предлагаются расширенные возможности управления беспроводными динамиками Hercules —

WAE Outdoor Rush и WAE Outdoor 04Plus FM:
-	полное управление функцией FM-радио динамика;
-	геолокация: беспроблемная настройка на локальные радиостанции в любой точке мира;
-	просыпайтесь под любимую музыку благодаря функции будильника.

WAE NEO — беспроводной динамик, сочетающий мощное звучание с волшебством света:
- выбирайте световые режимы, чтобы расцветить музыку по своему вкусу;
- палитра из 16 млн цветов на выбор;
- управление цветами подсветки;
- регулировка интенсивности световых эффектов динамика;
- возможность вдвое продлить время автономной работы динамика при прослушивании музыки без подсветки.

